@author trevor
This is the main Midlet class for the core J2ME application It contains all the basic functionality that should be executable in any standard J2ME device that supports MIDP 1.0 or higher. Any additional J2ME features for this application that are dependent upon a particular device (ie. optional or proprietary library) are de-coupled from the core application so they can be conditionally included depending on the target platform
This Application provides a basic Photo Album interface that allows a user to view images on their mobile device.

@author tyoung
This class represents the data model for Photo Albums. A Photo Album object is essentially a list of photos or images, stored in a Hashtable. Due to constraints of the J2ME RecordStore implementation, the class stores a table of the images, indexed by an identifier, and a second table of image metadata (ie. labels, album name etc.)
This uses the ImageAccessor class to retrieve the image data from the recordstore (and eventually file system etc.)

